    const [state2, dispatch2] = useReducer(reducer2, initialState);
    return <div onClick={() => {
        dispatch1({type: 'increment'});
        dispatch2({type: 'decrement'});
        console.log(state1, state2);
    }}>
        {`${state1.value1} + ${state2.value2}`}
    </div>
}
